import React, {Component} from 'react'
import './register_style.css'

class Register extends React.Component {
    constructor() {
        super();
        this.state = {
            email: '',
            password: ''
        }
    }

    submit_register = (event) =>{
        event.preventDefault();
        console.log(this.state.email + " " + this.state.password);
        this.setState({email : ''});
        this.setState({password: ''});

    }
    email_change = (event) => {
        this.setState({email : event.target.value});
    }
    password_change = (event) => {
        this.setState({password : event.target.value});
    }
    firstname = (event) => {
        this.setState({email : event.target.value});
    }
    surname = (event) => {
        this.setState({email : event.target.value});
    }

    render() {
    return (
        <div class = "register">
            <form onSubmit={this.submit_register}>
                <div class = "names">
                <label style={{marginTop: 100, marginBottom:5} }>First Name</label>

                <input type = "text" value = {this.state.email} onChange = {this.firstname}/>

                <label style={{marginTop: 20, marginBottom:5}}>Surname</label>

                <input type = "password" onChange={this.password_change}/> 
                <button>log in</button>
                </div>
            </form>
            <div style={{margin:5, marginLeft:195}}>
                <a href = "forgotpasspage" style={{textDecoration:"none", color: "black", fontSize:17}}>forgot password? </a>
            </div>
            <p style={{fontSize:17, marginTop:150}}>Not a member? <a href = "registerpage" style={{textDecoration: "none"}}>Register</a> </p>
        </div>
    );
    }
}

export default Register;
